import React, { Component } from 'react';

class Contacts extends Component {
  constructor() {
    super();
    this.state = {
      contacts: [
        {
          id: 1,
          name: 'Rakesh Kumar',
          email: 'rkakumar85@gmail.com',
          phone: '111-111-1111'
        },
        {
          id: 2,
          name: 'Rakesh Kumar',
          email: 'rkakumar85@gmail.com',
          phone: '111-111-1111'
        },
        {
          id: 3,
          name: 'Rakesh Kumar',
          email: 'rkakumar85@gmail.com',
          phone: '111-111-1111'
        }
      ]
    };
  }
  render() {
    const { contacts } = this.state;
    return (
      <div>
        {contacts.map(contact => (
          <h4>contact.name</h4>
        ))}
      </div>
    );
  }
}

export default Contacts;
